MongoDB query timing out even though I indexed the fields<p>I am running a query on a very large collection (500m documents) which is timing out sometimes (6 minutes) or takes very long (3-6 minutes).</p>

<p>I indexed all the relevant fields (no compound index): Tag, trophies, battleLogMonitorFrequency, profileRefreshedAt are indexed and the totalIndexSize is lower than 60% of my memory (45gb indexsize of 153gb which are available for mongodb).</p>

<pre><code>const oneHour: number = 1000 * 60 * 60;
      const projection: {} = { tag: 1 };
      const filter: {} = {
        battleLogMonitorFrequency: interval,
        profileRefreshedAt: { $lt: new Date(snapDate.valueOf() - interval * oneHour) }
      };
const profileCursorTrophies: QueryCursor&lt;IPlayerProfileModel&gt; = PlayerProfile.find(filter, projection).sort({ trophies: -1 })
        .limit(50000).lean().cursor();
      await profileCursorTrophies.eachAsync(
        (profile: IPlayerProfileModel) =&gt; {
          outDatedProfileTags.push(profile.tag);
        },
        { parallel: 100 }
      );
</code></pre>

<p><strong>My question:</strong></p>

<p>Why does it take so long (that it even times out) until I get a sorted result? I was under the impression that indexing the fields I sort and filter on should be enough for that query?</p>

<p><strong>Edit:</strong> Full query explain results: <a href="https://hastebin.com/ofixobasix.bash" rel="nofollow noreferrer">https://hastebin.com/ofixobasix.bash</a></p>

<p><strong>Edit 2:</strong> Output of getIndexes(): <a href="https://hastebin.com/azayojokez.scala" rel="nofollow noreferrer">https://hastebin.com/azayojokez.scala</a></p>

<p><strong>Edit 3:</strong> After recommendations to use a compound index for my query, I noticed the results haven't changed at all. The query still takes a very long time to execute. See the following explain results: <a href="https://hastebin.com/ragixuqaci.bash" rel="nofollow noreferrer">https://hastebin.com/ragixuqaci.bash</a></p>

<p>This index has been added:</p>

<pre><code>    {
            "v" : 2,
            "key" : {
                    "battleLogMonitorFrequency" : 1,
                    "profileRefreshedAt" : 1,
                    "trophies" : -1
            },
            "name" : "battleLogMonitorFrequency_1_profileRefreshedAt_1_trophies_-1",
            "ns" : "dbname.playerprofiles",
            "background" : true
    }
</code></pre>

