MongoDB combining group aggregation and strLenBytes<p>I've a Mongo collection with documents like this:</p>

<pre class="lang-js prettyprint-override"><code>{
    "_id" : ObjectId("5a9d0d44c3a1ce5f14c6940a"),
    "topic_id" : "5a7af30613b79405643e7da1",
    "value" : "VMware Virtual Platform",
    "timestamp" : "2018-03-05 09:26:25.136546",
    "insert_ts" : "2018-03-05 09:26:25.136682",
    "inserted_by" : 1
},
{
    "_id" : ObjectId("5a9d0d44c3a1ce5f14c69409"),
    "topic_id" : "5a7af30713b79479f82b4b84",
    "value" : "VMware, Inc.",
    "timestamp" : "2018-03-05 09:26:25.118931",
    "insert_ts" : "2018-03-05 09:26:25.119081",
    "inserted_by" : 1
},
{
    "_id" : ObjectId("5a9d0d44c3a1ce5f14c69408"),
    "topic_id" : "5a7af30713b7946d6d0a8772",
    "value" : "Phoenix Technologies LTD 6.00 09/21/2015",
    "timestamp" : "2018-03-05 09:26:25.101624",
    "insert_ts" : "2018-03-05 09:26:25.101972",
    "inserted_by" : 1
}
</code></pre>

<p>I would like to fetch some aggregated data from this collection. I want to know the oldest timestamp, the documents count and the total strlen of all values, but grouped by topic_id, where the document-id is greater than x.</p>

<p>In mysql, i would build a sql like this:</p>

<pre class="lang-sql prettyprint-override"><code>SELECT 
    MAX(_id) as max_id,
    COUNT(*) as message_count,
    MIN(timestamp) as min_timestamp,
    LENGTH(GROUP_CONCAT(value)) as size
FROM `dev_topic_data_numeric` 
WHERE _id &gt; 22000
GROUP BY topic_id
</code></pre>

<p>How do i achieve this in MongoDB? I already tried to build it looking like this:</p>

<pre class="lang-js prettyprint-override"><code>db.getCollection('topic_data_text').aggregate(
[
    {
        "$match": 
        {
            "_id": {"$gte": ObjectId("5a9d0aefc3a1ce5f14c68c81") }
        }
    },
    {
        "$group": 
        {
            "_id": "$topic_id",
            "max_id": {"$max":"$_id"},
            "min_timestamp": {"$min": "$timestamp"},
            "message_count": {"$sum": 1},
            /*"size": {"$strLenBytes": "$value" }*/
        }
    } 
]
);
</code></pre>

<p>Then i uncomment <code>$strLenBytes</code> it crashes saying, that strLenBytes is not a group operator. The <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/strLenBytes/#exp._S_strLenBytes" rel="nofollow noreferrer">API of MongoDB</a> does not help me here. How do i have to write it to get the strlen?</p>

<p>My expected result should look like this:</p>

<pre class="lang-js prettyprint-override"><code>{
    "_id" : "5a7af30613b79405643e7da1",
    "max_id" : ObjectId("5a9d0d44c3a1ce5f14c6940a"),
    "min_timestamp" : "2018-03-05 09:26:25.136546",
    "message_count" : 1,
    "size" : 23,
}
</code></pre>

<p>My MongoDB version is 3.4.4.</p>

