Express and Mongoose-property is not being saved<p>TL;DR: I'm trying to save a new object, one of the fields is not saving, others save fine.</p>

<p>I've got a Mongoose schema with a property called superPlotId:</p>

<pre><code>const mongoose = require('mongoose');
const GeoJSON = require('mongoose-geojson-schema');
const Schema = mongoose.Schema;
const plotSchema = new Schema(
    {
        ...fields...
        superPlotId: String,
        ...more fields
    },
    { strict: false },
    { bufferCommands: false }
);

//create model class
const ModelClass = mongoose.model('plot', plotSchema);

//export model
module.exports = ModelClass;
</code></pre>

<p>I'm trying to save a new object fitting this schema with Express, like this:</p>

<pre><code>exports.newPlot = async (req, res, next) =&gt; {
    const {
        ...a bunch of fields...
        superPlotId
    } = req.body.props;
    const plot = new Plot({
        ...a bunch of fields...
        superPlotId
    });
    console.log(('new plot:', JSON.stringify(plot)));
    try {
        const newPlot = await plot.save();
        res.json(newPlot);
    } catch (e) {
        console.log("couldn't save new plot", JSON.stringify(e));
        return res.status(422).send({ error: { message: e, resend: true } });
    }
};
</code></pre>

<p>I know that a properly formatted object is hitting the endpoint, because the console.log above shows it:</p>

<pre><code>{...bunch of fields..."superPlotId":"5a9e9f9f0f8a8026005fe1e7"}
</code></pre>

<p>And yet the plot appears in my database without the superPlotId field.</p>

<p>Anyone know what I'm missing here?</p>

