What filter definition for MongoDb should I use in C#?<p>imagine this situation:</p>

<p>I have a entity called <strong>Filter</strong> with:</p>

<p><code>string Text { get; set; }
 string State { get; set; }
</code></p>

<p>So in my Mongo collection I have this documents (filters):</p>

<pre><code>{
"id" : "1",
"State" : "333",
"Text" : "SD"
},
{
"id" : "2",
"State" : "444",
"Text" : "X"
}
</code></pre>

<p>Now I have a service that it is supposed to return all the documents with the match of texts and states. </p>

<p>So imagine my service receives a <code>IEnumerable&lt;string&gt; texts</code> and  a <code>IEnumerable&lt;string&gt; states</code> with this values:</p>

<pre><code>"states" : ["333","444"],
"texts" : ["SD"]
</code></pre>

<p>And the service should return <code>[]</code> because there aren't Filters with <strong>state "333"</strong> and <strong>state "444"</strong> with <strong>text "SD"</strong> at the same time. It only should return Results if my collection had this documents:</p>

<pre><code>{
"id" : "1",
"State" : "333",
"Text" : "SD"
},
{
"id" : "2",
"State" : "444",
"Text" : "SD"
}
</code></pre>

<p>Then the response would be: </p>

<pre><code>{
"id" : "1",
"State" : "333",
"Text" : "SD"
},
{
"id" : "2",
"State" : "444",
"Text" : "SD"
}
</code></pre>

<p>My actual code to create my Filter Definition for this situation is:</p>

<pre><code>    private FilterDefinition&lt;MyFilterEntity&gt; CreateFilterForMyFilterEntity(IEnumerable&lt;string&gt; texts, IEnumerable&lt;string&gt; states)
    {
        var filterBuilder = Builders&lt;MyFilterEntity&gt;.Filter;
        var filter = filterBuilder.Empty;

        if (ListNotNullOrEmpty(texts))
        {
            filter = filter &amp; filterBuilder.In(rf =&gt; rf.Text, texts);
        }

        if (ListNotNullOrEmpty(states))
        {
            filter = filter &amp; filterBuilder.In(rf =&gt; rf.State, states);
        }

        return filter;
    }
</code></pre>

<p>But for my example case this code returns the response: </p>

<pre><code>{
"id" : "1",
"State" : "333",
"Text" : "SD"
}
</code></pre>

<p>when it should be <code>[]</code> as I said before. </p>

<p>Is there a way to solve this situation? Thank you.</p>

<p>I am using ASP.NET Core 2.0 with MongoDb.Driver 2.5.0.</p>

